import React from 'react';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import {useStyles} from './styles';
import Imgs from '../../img/blob-shape.svg';

const Cards = ({clave_materia , nombre,modalidad, semestre}) =>{
const classes = useStyles();

    return(
<>
<Card style={{backgroundColor:'whitesmoke',backgroundPosition: 'left', marginTop:4 ,width:400,textAlign:'center',backgroundImage:"url(" +Imgs+ ")"}} className={classes.root}>
      <CardContent>
        <Typography className={classes.title} color="textSecondary" gutterBottom>
          Materia
        </Typography>
        <Typography component="h2">
         <small >{nombre}</small> 
        </Typography>
        <Typography className={classes.pos} color="textSecondary">
          Modalidad: {modalidad}
        </Typography>
        <Typography variant="body2" component="p">
          well meaning and kindly.
          <br />
          {clave_materia}
        </Typography>
      </CardContent>
      <CardActions>
    <Button size="small">Semestre: "{semestre}"</Button>
      </CardActions>
    </Card>
</>
    );
}

export default Cards;
